INSERT INTO `znote_changelog` (`id`, `text`, `time`, `report_id`, `status`) VALUES
	(1, 'Quest giver &quot;Soraya&quot; has setup shop in the Municipal Square area.  ', 1448133050, 0, 35),
	(2, 'Fixed Spawning issues in Vampire Section. ', 1448221124, 0, 35),
	(3, 'Edited Drop Rates on quest items for Soraya\'s quest chain. Adjusted to drop in a more timely fashion. ', 1448221199, 0, 35),
	(4, '7 New houses added to Bayside. A suburb just South of Drogheda. Bayside Farm and Cottages. ', 1448240157, 0, 35),
	(5, 'New Stage added &quot;3x&quot;: See Serve info page for details.', 1448306731, 0, 35),
	(6, '6 New houses added to Bayside Shops.', 1448561443, 0, 35),
	(7, 'VIP Accounts now receive 2x more experience.\r\n ', 1448582184, 0, 35),
	(8, 'Drogheda Temple redesigned. Shop NPC\'s have moved. \r\n', 1448664395, 0, 35),
	(9, 'New NPC: Jeeves - banker', 1448664572, 0, 35),
	(10, 'Ingame Market now works with the use of Jeeves (banker). ', 1448689120, 0, 35),
	(11, 'Issue with new characters &quot;First Login&quot; resolved. A simple storage issue for VIP system. ', 1448904087, 0, 35),
	(12, 'New NPC, Damon. He will unlock his chest. If you do something for him.', 1448913268, 0, 35),
	(13, 'New Talkactions Added:\r\n!afk\r\n!commands\r\n!spells', 1448936446, 0, 35),
	(14, 'New NPC, Tits. She is a flashy bar wench looking for revenge.', 1448948991, 0, 35),
	(16, 'Varkhal has setup shop in the Drogheda Temple. He will sell you addons for a nominal fee. ', 1449077286, 0, 35),
	(17, 'Starting Zone: map update - underground area improved. ', 1449447053, 0, 35),
	(18, 'New NPC: Jailbird. Help him gather food.', 1449532558, 0, 35),
	(19, 'Ultimate Healing Rune: Requires level 80, up from 30. Magic level 6, up from 1.', 1449548901, 0, 35),
	(20, 'Soul Points are now rewarded per monster killed, while below max limit per promotion. ', 1449632758, 0, 35),
	(22, 'Stormblast\'s Chamber has been remodeled. Less obstacles to get in the way.', 1449795795, 0, 35),
	(23, 'Lilith: Second phase of quests leading into &quot;Frozen Hell&quot;.', 1449868952, 0, 35),
	(24, 'Lilith\'s Reign of Terror: quest log completed. ', 1449988074, 0, 35),
	(25, 'Devlin: VIP token Sales. Free roaming within Drogheda. ', 1450031632, 0, 35),
	(26, 'Jailbird: questlog added. ', 1450056788, 0, 35),
	(27, 'Assassin Star: Updated to +5 Distance on Equip. ', 1450142183, 0, 35),
	(28, 'Drunk effect now works with alcoholic beverages. hicks! ', 1450380336, 0, 35),
	(31, 'Blue Robe: +2 ML &amp; 5% mana increase', 1450576274, 0, 35),
	(32, 'HeadChopper Axe: Weight reduced to 40 oz, from 45. \r\n				 Reduced to a 1 handed weapon, from 2 handed weapon.\r\n				 Adds 20% extra hp on equip.', 1450576341, 0, 35),
	(33, 'Great mana potion\\Great spirit potion\\Ultimate health potion: Revised to lvl 300 standards.', 1450604072, 0, 35),
	(35, '&quot;A Guided Tour of Decapitated Soul&quot; is now a starter Item. When equipped properly in your ring slot, grants player a 20%hp/mana boost, as well as faster regeneration.', 1450638329, 0, 35),
	(36, 'Knights now start with weapon choices. Choose wisely. this way help you with future weapons.', 1450638460, 0, 35),
	(37, 'Five new houses added to Drogheda. Along the Elm Street area. ', 1450646172, 0, 35),
	(40, 'Bug with &quot;First Items&quot; corrected on knights.  ', 1450672804, 0, 35),
	(41, 'VIP xp Bonus 2.0%, up from 1.5%', 1450774594, 0, 35),
	(43, 'Greeter\'s quest is repaired. Wrong Storage id being set. ', 1450859828, 0, 35),
	(44, 'Dragon Lord damage increased to accommodate for proper level requirements on &quot;Soraya\'s Vengeance&quot; ', 1450973212, 0, 35),
	(46, 'Skinning system implemented.Obsidian knife is rewarded or can be purchased. ', 1451184154, 0, 35),
	(48, 'Weapon skill Reward System implemented.', 1451184182, 0, 35),
	(49, 'Demon Oak added to Southern Drogheda.', 1451184270, 0, 35),
	(50, 'Max depot items up to 100, from 50.', 1451259023, 0, 35),
	(51, 'Intense healing rune, dropped to 50 gp per charge. Down from 95.', 1452023901, 0, 35),
	(52, 'Mana rune, dropped to 55 gp per charge. Down from 100.', 1452023935, 0, 35),
	(53, 'Newly remodeled Teleport Room opened.', 1452038549, 0, 35),
	(54, '&quot;Frozen Wastes&quot; opened', 1452038573, 0, 35),
	(55, 'Reign of Terror: Frost Dragon added', 1452039190, 0, 35),
