INSERT INTO `znote_forum_posts` (`id`, `thread_id`, `player_id`, `player_name`, `text`, `created`, `updated`) VALUES
	(12, 18, 1, 'God Caduceus', '[img]http://decapitatedsoul.servegame.com/images/screens/mob_bosses.PNG[/img]\r\n\r\n&quot;We look like Mob Bosses!&quot;', 1473807626, 1473807779);
INSERT INTO `znote_forum_threads` (`id`, `forum_id`, `player_id`, `player_name`, `title`, `text`, `created`, `updated`, `sticky`, `hidden`, `closed`) VALUES
	(3, 7, 1, 'Caduceus', 'We need your help!', '      [b]W[/b]e cannot improve without your feedback! Do you feel an area is to easy? Items are not strong enough/too strong, or just think cooldowns are not right... give us a line.. tell us what you think.', 1449200973, 1470360761, 1, 0, 0),
	(13, 1, 1, 'Caduceus', 'test', 'this is just a test', 1452279196, 1452279196, 0, 0, 0),
	(17, 6, 1, 'Caduceus', 'Decapitated Soul Quests', '   \r\n   Want to make the Gallery? Email your screenshots from Decapitated Soul to [b]decapitatedsoulot@gmail.com[/b] If your screen is chosen, you will win a double experience scroll! \r\n\r\n[img]http://decapitatedsoul.servegame.com/images/divider.png[/img]\r\n\r\n[b]Annialator Quest[/b]\r\n[img]http://decapitatedsoul.servegame.com/images/screens/anni.png[/img]\r\n[img]http://decapitatedsoul.servegame.com/images/screens/anni_complete.png[/img]\r\n\r\n[b]Demon Helmet Quest[/b]\r\n[img]http://decapitatedsoul.servegame.com/images/screens/DHQ.png[/img]\r\n\r\n[b]Demon Oak Quest[/b]\r\n[img]http://decapitatedsoul.servegame.com/images/screens/demonoak_fight.png[/img]\r\n[img]http://decapitatedsoul.servegame.com/images/screens/demonoak_lestat.png[/img]\r\n\r\n[b]Gateway to the Apocalypse[/b]\r\n[img]http://decapitatedsoul.servegame.com/images/screens/Apoc_entrance.PNG[/img]\r\n', 1457923595, 1457923595, 1, 0, 0),
	(18, 6, 1, 'Caduceus', 'Featured Screens: Player Entry', 'Show us your view..', 1458451152, 1473807633, 0, 0, 0),
	(19, 6, 1, 'Caduceus', 'Server Features', 'Coming Soon, maybe, pimp!\r\n\r\nWant to make the Gallery? Email your screenshots from Decapitated Soul to [b]decapitatedsoulot@gmail.com[/b] If your screen is chosen, you will win a double experience scroll! \r\n\r\n[img]http://decapitatedsoul.servegame.com/images/divider.png[/img]\r\n\r\n[b]Offline Training[/b]\r\n[img]http://decapitatedsoul.servegame.com/images/screens/Offline_Training.png[/img]', 1458451209, 1458451209, 1, 0, 0),
	(24, 4, 1, 'Caduceus', 'Let us know how to improve the server.', 'We need your help making the server better. How can we improve the game play? ', 1527128225, 1527128225, 1, 0, 1),
	(25, 3, 2, 'Vlad', 'Enchanting weapons.', '[center]Guidelines    [/center]\r\n\r\nCatacombs melee weapons and sniper arrows can be enchanted by using enchanted gems. The gems can be looted by various creatures throughout the server.\r\n\r\n[b]Emeralds:[/b] Used to make the earth enchant you must first locate the earth altar.\r\n\r\n[b]Ruby:[/b] Give the fire enchant once again you must find the fire altar.\r\n\r\n[b]Sapphires:[/b] Give the ice enchantment.\r\n\r\n[b]Amethysts:[/b] Give the energy enchantment.\r\n\r\nMelee weapons get 1000 charges per gem.\r\nArrows for paladins you can enchant 100 arrows at a time, but they have a chance of breaking.\r\n\r\nWhen you find the alters each gem costs 20 soul to enchant.\r\n\r\n[b] Enchant Weapons List[/b]\r\n[b] Barbarian Axe[/b]\r\n[b] Knight Axe[/b]\r\n[b] Heroic Axe[/b]\r\n[b] Headchopper[/b]\r\n[b] War Axe[/b]\r\n[b] War Hammer[/b]\r\n[b] Cranial Basher[/b]\r\n[b] Crystal Mace[/b]\r\n[b] Clerical Mace[/b]\r\n[b] Orcish Maul[/b]\r\n[b] Blacksteel Sword[/b]\r\n[b] Dragon Slayer[/b]\r\n[b] Relic Sword[/b]\r\n[b] Mystic Blade[/b]\r\n[b] Spike Sword[/b]\r\n[b] Rainbow Shield[/b]\r\n[b] Sniper Arrows[/b]\r\n\r\nIf you have any questions, feel free to ask in game. We will be happy to help.\r\n\r\nThank you for viewing this installment of the Vladipedia.\r\n\r\n', 1539205121, 1539205121, 0, 0, 1),
	(26, 3, 2, 'Vlad', 'VIP', '[b][center] VIP Advantages[/center][/b]\r\n   \r\n\r\n[b] Double Experience boost[/b] level faster, less work!\r\n\r\n[b] Bonus gold[/b] per kill helps you buy that special mansion.\r\n\r\n[b]VIP exclusive commands[/b] such as !t and !bless.\r\n\r\n[b] The VIP portal system[/b] save yourself time. Teleport to your favorite hunting zone.\r\n\r\n   Here it is in a nutshell. VIP is bought with either daily tokens or coins and makes sure you have a better overall gaming experience with us here on Decapitated Soul!\r\n\r\n', 1539281237, 1539281237, 0, 0, 1),
	(27, 3, 2, 'Vlad', 'Quests', '[center] Quests[/center]\r\n\r\n[b]Black Knights[/b] Receive a buckethead helmet within this spawn.  \r\n\r\n[b] Catacombs[/b] Level 100 Weapon Quest, Solo or Team-up.\r\n\r\n[b] Demon Helmet[/b] 2 Person Quest.\r\n\r\n[b] Demon Oak[/b] Solo Quest.\r\n\r\n[b] Anni. Quest[/b] This is a 4 person group quest.\r\n\r\n[b] Pirates Quest[/b] Team-up quest near Lonrich.\r\n\r\n[b] Frozen Hell[/b] Solo quest for high end weapon.\r\n\r\n[b] Medusa Dungeon[/b] Team-up repeatable daily quest. \r\n\r\n[b] Apoc. Daily Chest[/b] Like rotworm daily chest repeatable daily.\r\n\r\n    And as always if you have questions feel free to ask we will be glad to assist you.', 1539358475, 1539358475, 0, 0, 1),
	(28, 3, 2, 'Vlad', 'Lootable Mount Items.', '[center]Lootable Mount Items[/center]\r\n\r\n[b]Dragon Tail[/b] This item gives you the green dragon hatchling mount. It is dropped by Dragons.\r\n\r\n[b]Enchanted Chicken Wing[/b] This item gives you the Chocobo Mount. This item is dropped by Chocobo Warriors.\r\n\r\n[b]Ghastly Dragon Head[/b] This item is dropped by Ghastly Dragons. It gives the Ghastly Dragon Mount and is the fastest mount in game at the moment.\r\n\r\n   Each of the items have a different drop rate and may take sometime to acquire.', 1539450726, 1539450726, 0, 0, 1),
	(29, 3, 2, 'Vlad', 'Autoloot System', '[center]Autoloot System[/center]\r\n\r\n    The autoloot system is fairly simple to use lets run through the commands.\r\n\r\n[b]!autoloot add[/b] Use this command to add items to your autoloot menu ex. !autoloot add, lump of coal.\r\n\r\n[b]!Autoloot remove[/b] Use this command to remove items from list. !autoloot remove, lump of coal.\r\n\r\n[b]!autoloot show[/b] This command shows your autoloot listings.\r\n\r\n[b]!autoloot clear[/b] This command removes all of you autoloot listings.\r\n\r\nThe autoloot system only allows adding 5 items to it, so you will have to remove quest items at completion of the quest before adding the next ones.\r\n\r\nAnd as always if you have questions feel free to ask a member of our Staff.', 1539607554, 1539607554, 0, 0, 1),
	(30, 3, 2, 'Vlad', 'Hourly coins.', '[center]Hourly Coins and the use of[/center]\r\n\r\n   Some of you may have noticed you gain a coin for every hour on the server, but whats it for well Im going to tell you.\r\n\r\n   The hourly coins are used to purchase an assortment of things from our in-game Decapitated Soul store.\r\n\r\n  To redeem your coins you simply log in to your Tibia client (downloaded from our website) and click on the store icon under your inventory.Examples of some of our goods.\r\n\r\n[b]Addons[/b]\r\n[b]Mounts[/b]\r\n[b]Rugs[/b]\r\n[b]Special furnishings[/b]\r\n[b]Vip[/b](also buyable in game from Brevan)', 1539608006, 1539608006, 0, 0, 1),
	(31, 3, 2, 'Vlad', 'Drogheda Hunting Areas', '[center]Drogheda Hunting[/center]\r\n\r\n[b]Cyclops[/b] To get to cyclops from temple go to ground floor go out of the temple head east.\r\n\r\n[b]Black Knights[/b] Black Knights are located in the cyclops zone in the southern portion explore till you see Caduceus Manor and you are getting close.\r\n\r\n[b] Dragon Hatchlings[/b] Ride the subway car from temple to first stop go up the stairs head south you will run right into them.\r\n\r\n[b]Dragons and Dragonlords[/b] Ride the subway both cars till the end go up the stairs they are  directly east of the train stop across the bridge.\r\n\r\n[b]Vampires[/b] Ride the train to first stop go up the stairs and head west till you see ghouls and skeletons, go over the mountain into the building underground is the vampires.', 1539639833, 1539639833, 0, 0, 1);
